/* Function: mdlOutputs =======================================================
 *
*/
static void mdlOutputs(SimStruct *S, int_T tid)
{
    const real_T   *u  = (const real_T*) ssGetInputPortSignal(S,0);
    real_T        *z  = (real_T *)ssGetOutputPortRealSignal(S,0);
    real_T        *xy  = (real_T *)ssGetOutputPortRealSignal(S,1);
    real_T        *psi  = (real_T *)ssGetOutputPortRealSignal(S,2);
    real_T        *v  = (real_T *)ssGetOutputPortRealSignal(S,3);
    const real_T   *xC = ssGetContStates(S);

    bike_Outputs_wrapper(u, z, xy, psi, v, xC);
}

