/* Function: mdlDerivatives =================================================
   * Abstract:
   *    In this function, you compute the S-function block's derivatives.
   *    The derivatives are placed in the derivative vector, ssGetdX(S).
   */
  static void mdlDerivatives(SimStruct *S)
  {
    const real_T   *u  = (const real_T*) ssGetInputPortSignal(S,0);
    real_T         *dx  = ssGetdX(S);
    real_T         *xC  = ssGetContStates(S);
    real_T        *z  = (real_T *) ssGetOutputPortRealSignal(S,0);
    real_T        *xy  = (real_T *) ssGetOutputPortRealSignal(S,1);
    real_T        *psi  = (real_T *) ssGetOutputPortRealSignal(S,2);
    real_T        *v  = (real_T *) ssGetOutputPortRealSignal(S,3);

    bike_Derivatives_wrapper(u, z, xy, psi, v,dx,  xC);
}

